import { View, Text, Image } from 'react-native'
import React from 'react'

const ProductImage = ({ source, style, resizeMode }) => {
  return (
    <>
      <Image source={{ uri: source }} resizeMode={resizeMode} style={style} />
    </>
  );
};

export default ProductImage
